import { useParams } from "react-router-dom";
import axios from "axios";
import { useEffect, useState } from "react";
import DisplayProjects from "../DisplayProjects/index";

export default function Projects({projectName}) {
  const [data, setData] = useState([]);
  // const [projects, setProjects] = useState([]);

  const { type } = useParams();

  useEffect(() => {
    axios.get(`http://localhost:5000/project/${type}`).then((res) => {
      const arr = res.data.concat(projectName)
      setData(arr);
      console.log(data);
    });
  }, []);

  return (
    <>
      {data.map((elem) => {
        return (
          <DisplayProjects
            name={elem.name}
            type={elem.type}
            desc={elem.desc}
            teamNeeded={elem.teamNeeded}
            level={elem.level}
          />
        );
      })}
    </>
  );
}
